import React from "react";

function App() {
  const style = {textAlign: "center"};
  return (
    <div>
      <h1 style={style, fontFamily="cursive"}>Hello!</h1>
      <h4 style={style}>How are you?</h4>
      <h5 style={style}>Today is a nice day!</h5>
    </div>
  );
}

export default App;
